import logo from './logo.svg';
import './App.css';
import Navbar from './components/Navbar';
import AddUser from './components/AddUser';
import Home from './components/Home'
import AllUsers from './components/AllUser'

function App() {
  return (
    <div className="App">
      <Navbar/>
      <AddUser/>
      <Home/>
      <AllUsers/>
    </div>
  );
}

export default App;
